using namespace std;

struct Node {
    int key;
    Node* left;
    Node* right;
    Node(int k) : key(k), left(nullptr), right(nullptr) {}
};

class BST {
public:
    BST() : root(nullptr) {}

    void insert(int key) {
        root = insertRec(root, key);
    }

    bool find(int key) {
        return findRec(root, key);
    }

    void inorder() {
        inorderRec(root);
        cout << endl;
    }

    void preorder() {
        preorderRec(root);
        cout << endl;
    }

private:
    Node* root;

    Node* insertRec(Node* node, int key) {
        if (node == nullptr) {
            return new Node(key);
        }
        if (key < node->key) {
            node->left = insertRec(node->left, key);
        } else {
            node->right = insertRec(node->right, key);
        }
        return node;
    }

    bool findRec(Node* node, int key) {
        if (node == nullptr) {
            return false;
        }
        if (node->key == key) {
            return true;
        }
        if (key < node->key) {
            return findRec(node->left, key);
        }
        return findRec(node->right, key);
    }

    void inorderRec(Node* node) {
        if (node != nullptr) {
            inorderRec(node->left);
            cout << node->key << " ";
            inorderRec(node->right);
        }
    }

    void preorderRec(Node* node) {
        if (node != nullptr) {
            cout << node->key << " ";
            preorderRec(node->left);
            preorderRec(node->right);
        }
    }
};

int main() {
    BST tree;
    int n;
    cin >> n;

    for (int i = 0; i < n; ++i) {
        string operation;
        cin >> operation;

        if (operation == "insert") {
            int key;
            cin >> key;
            tree.insert(key);
        } else if (operation == "find") {
            int key;
            cin >> key;
            if (tree.find(key)) {
                cout << "Found" << endl;
            } else {
                cout << "Not Found" << endl;
            }
        } else if (operation == "inorder") {
            tree.inorder();
        } else if (operation == "preorder") {
            tree.preorder();
        }
    }

    return 0;
}
